import React, {componete} from 'react';

class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      titulo: "Primeira Página com Class Component"
    }
  }

  mudar(){
    console.log("mudou");
  }

  render() {
    return(
      <div>
      <h1>
        {this.state.titulo}
        <button onClick={this.mudar}>Mudar Título</button>
        </h1>
      </div>
    )
  }

}

export default App;
